import React from "react";

import { Box, Container, Grid, List } from "@mui/material";
import { styled } from "@mui/material";
import img from "../ asset/fod.jpeg";

const Logo = styled("img")(({ theme }) => ({
  position: "relative",
  width: "100px",
  display: "flex",
  top: "40px",

  [theme.breakpoints.down("sm")]: {
    width: "100px",
    position: "relative",
    left: "",
    top: "50px",
  },
}));

function Home() {
  return (
    <>
      <Box
        sx={{
          height: "799px",
          maxWidth: "100%",
          backgroundColor: "#000000",
        }}
      >
        <Container>
          <Grid container>
            <Grid item xs={12} sm={6}>
              <Logo src={img}></Logo>
            </Grid>
            <Grid item xs={12} sm={6}></Grid>
          </Grid>
        </Container>
      </Box>
    </>
  );
}

export default Home;
